    computed: {
        medailles: function () {
            return this.personnes.map(function (p) {
                if (p.Medaille == 'BRONZE - ARGENT - OR') {
                    return "bronArgOr";
                }
                if (p.Medaille == 'ARGENT - OR') {
                    return "argOr";
                }
                if (p.Medaille == 'BRONZE') {
                    return "bron";
                }
                else {
                    return "medaillesOff";
                }
            })
        },
        couleurSex: function () {
            // x = this.femmes;
            return this.personnes.map(function (p) {
                if (p.Femmes == 'Oui') {
                    return p.Femmes.replace("Oui", "F");
                }
                if (p.Hommes == 'Oui') {
                    return p.Hommes.replace("Oui", "H");
                }
                else {
                    return "M";
                }
            })
        },

        miseEnForme: function () {
            return this.personnes.map(function (p) {
                if (window.innerWidth < 420) {
                    return p.Nom.replace(", ", ' \n')
                        .replace(" kg", ' kg')
                        .replace(" kg", ' kg')
                        .replace("femmes", 'Femmes')
                        .replace("hommes", 'Hommes');
                } else {
                    return p.Nom.replace(" - ", '\n').replace(", ", '\n');
                }

            })

        },

        jours: function () {
            return this.personnes.map(function (p) {
                return p.Date.replace("lundi", "Lun").replace("mardi", "Mar").replace("mercredi", "Mer").replace("jeudi", "Jeu").replace("vendredi", "Ven").replace("samedi", "Sam").replace("dimanche", "Dim").replace("juillet", "juil.");
            })

        }
    },
